import React from 'react';

function Footer() {
  return (
    <footer>
      <p>&copy; 2025 Tours and Travel. All rights reserved.</p>
      <nav>
        <a href="#about">About</a>
        <a href="#contact">Contact</a>
      </nav>
    </footer>
  );
}

export default Footer;
